in_cell = mat2cell(input, ones(1,140), 140);
nf = sum(cellfun(@numel, regexp(in_cell, 'XMAS')));
nb = sum(cellfun(@numel, regexp(in_cell, 'SAMX')));
inc_v = mat2cell(input', ones(1,140), 140);
nv = sum(cellfun(@numel, regexp(inc_v, 'XMAS')));
nw = sum(cellfun(@numel, regexp(inc_v, 'SAMX')));
in_diag = {}; in_ddia = {};
for ii = 1:(2*size(input, 1)-3)
    in_diag{ii} = diag(input, ii+1-size(input,1))';
    in_ddia{ii} = diag(fliplr(input), ii+1-size(input,1))';
end
nd1 = sum(cellfun(@numel, regexp(in_diag, 'XMAS')));
nd2 = sum(cellfun(@numel, regexp(in_diag, 'SAMX')));
ne1 = sum(cellfun(@numel, regexp(in_ddia, 'XMAS')));
ne2 = sum(cellfun(@numel, regexp(in_ddia, 'SAMX')));
nf+nb+nv+nw+nd1+nd2+ne1+ne2

%%
cmas = @(mas) numel(find(conv2(double(input), mas) == 29789));

m = double('M'); a = double('A'); s = double('S');
cmas([m 0 s; 0 a 0; m 0 s]) + ...
    cmas([s 0 s; 0 a 0; m 0 m]) + ...
    cmas([m 0 m; 0 a 0; s 0 s]) + ...
    cmas([s 0 m; 0 a 0; s 0 m])
